import React from 'react'; // Import React library to use their functionalities
import './App.css'; // Import App's css
import VideoList from './components/VideoList'; // Impor VideoList component for the back-end of the app

const App: React.FC = () => { // Define main coponent as react compnent function 
    return (
        <div className="App"> {/* Définit la classe CSS pour le div principal du composant App. */}
            <header className="App-header"> {/* Définit la classe CSS pour l'en-tête du composant App. */}
                <h1>Youtube Library</h1> {/* Affiche le titre de l'application. */}
            </header>
            <VideoList /> {/* Affiche le composant VideoList, qui gère et affiche la liste des vidéos. */}
        </div>
    );
};

export default App; // Exporte le composant App pour pouvoir l'utiliser dans d'autres parties de l'application.
